import { Box } from '@material-ui/core';
import { DataGrid } from '@material-ui/core';
import BodyStyle from './body.style';

function Body(props) {
  const styles = BodyStyle();

  return (
    <Box className={styles.body} minHeight={props.emptySpace}>
      <DataGrid rows={rows} columns={columns} pageSize={6} checkboxSelection />
    </Box>
  );
}

export default Body;
